from functools import cache
from typing import List

class Solution:
    def countSquares(self, matrix: List[List[int]]) -> int:
        # @cache
        def dp(rowIndex,colIndex,sqSize):
            global count
            global dict1
            st = f"{rowIndex},{colIndex},{sqSize}"
            # st=(rowIndex, colIndex, sqSize)
            # st=str(rowIndex)+str(colIndex)+str(sqSize)
            if st in dict1:
                return dict1[st]
            if sqSize==1:
                count+=matrix[rowIndex][colIndex]
                dict1[st]=matrix[rowIndex][colIndex]
                return matrix[rowIndex][colIndex]
            curMat=1
            
            for i in range(2):                
                for j in range(2):
                    curCount=dp(rowIndex+i,colIndex+j,sqSize-1)
                    if curCount==0:
                        curMat=0
                   
                    
            count+=curMat
            dict1[st]=curMat
            return curMat

        global count
        global dict1
        count=0
        dict1=dict()
        rowLength=len(matrix)
        colLength=len(matrix[0])
        if rowLength==colLength:
            dp(0,0,rowLength)
            return count
        elif rowLength<colLength:
            diff=colLength-rowLength+1
            for i in range(diff):
                dp(0,i,rowLength)
            return count
        else:
            diff=rowLength-colLength+1
            for i in range(diff):
                dp(i,0,colLength)
            return count

